import React,{useImperativeHandle} from 'react'

const Button = React.forwardRef((props,ref) => {

  useImperativeHandle(ref, ()=>{
    return {
      click: props.wrapperClickHandler
    }
  })

  return (
    <button type={props.type} onClick={props.clickButtonHandler} className="p-2 bg-blue-400 hover:bg-blue-500">{props.message}</button>
  )
})

export default Button;
